import React,{useState} from 'react';
import { useHistory } from 'react-router';
import { library } from '@fortawesome/fontawesome-svg-core'
import { faTrash } from '@fortawesome/free-solid-svg-icons'
import "./Reminder.css"
function NavigationNavPage(props) {
  const[Text,setText]=useState("");

  const history=useHistory();
 async function login(){
    console.warn(Text)
    let item={Text}
    let result=await fetch ("https://api-nodejs-todolist.herokuapp.com/task",
    {

      method:'POST',
      headers:{
        "Content-Type": "application/json",
        "Accept":"application/json",
        "Authorization":"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI1ZGRjY2JlYzZiNTVkYTAwMTc1OTcyMmMiLCJpYXQiOjE1NzQ3NTE2ODh9.GPbsl9FLX4VrsGVErodiXypjuz1us4tfD0jwg2_UrzY"
      },
      body:JSON.stringify(item)
    }
    
    );
    result =await result.json();
    localStorage.setItem("task",JSON.stringify(result))

  };
  return (
  
                



                <div className="App">
  
  <header>

              <div className="container" className="TO">
                <div className="row">
                  <div className="col-sm-4"><h1>TODO LIST  <button> 
                  <MDBIcon icon="plus" onClick={login}/>
                     <FaPlus className="plus" onClick={this.addItem} type="submit"/>
                     </button></h1></div>
                 </div>
                 </div>
                 <form id="to-do-form" onSubmit={this.addItem}>
               <input placeholder="write a note here" type="text" className="text-left"
               onChange={(e)=>setText(e.target.value)}></input>
               </form> 
               <List setUpdate={this.setUpdate} deleteItem={this.deleteItem} items={this.state.items}></List>

               <button onClick={login} className="btn btn-primary">Login</button>
               </header>
</div>











  );
}


export default NavigationNavPage
